import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [{
          name: 'Frankenstein'
        },

        {
          name: 'Dracula'
        },

        {
          name: 'Zombie'
        }
      ]
    };
  }
}

export default App;
